import React from 'react';
import { FaPlusSquare } from 'react-icons/fa';
const form = ({ setInputhandler, Inputhandler, Submitdata, setSubmitdata }) => {
	const HandlerInput = e => {
		setInputhandler(e.target.value);
	};
	const Confirmedata = () => {
		setSubmitdata({ data: Inputhandler, completed: false, id: Math.random() * 1000 });
		setInputhandler('');
	};

	return (
		<>
			<div className="input_parent">
				<input onChange={e => HandlerInput(e)} type="text" className="input_todo"></input>
				{/* <div className="todo_plus"></div> */}

				<FaPlusSquare
					className="plus"
					onClick={e => {
						Confirmedata();
					}}
				/>
			</div>
		</>
	);
};

export default form;
